// the semi-colon before function invocation is a safety net against concatenated
// scripts and/or other plugins which may not be closed properly.
;(function ( $, window, document, undefined ) {

	"use strict";
	// use image width height if possible


	// undefined is used here as the undefined global variable in ECMAScript 3 is
	// mutable (ie. it can be changed by someone else). undefined isn't really being
	// passed in so we can ensure the value of it is truly undefined. In ES5, undefined
	// can no longer be modified.

	// window and document are passed through as local variable rather than global
	// as this (slightly) quickens the resolution process and can be more efficiently
	// minified (especially when both are regularly referenced in your plugin).

	var ImageEffect = {
		FadeIn: "fadeIn",
		None: "none"
	};

	// Create the defaults once
	var pluginName = "imageLoadPolisher",
			defaults = {
				image_effect: ImageEffect.FadeIn,
				image_effect_duration: 1500, // number that determine how long image animation will run
				loader_source: "data:image/gif;base64,",
				loader_horizontal_position: "50%",
				loader_vertical_position: "50%",
				empty_image_source: "data:image/gif;base64,"
			};

	// Private vars
	var image_array = [];
	var empty_image_array = [];
	var loader_array = [];


	/*
	var privateMethod = function () {
		// ...
	};

	var load_delay = function() {

	};
	setTimeout(load_delay, 15);
*/
	// The actual plugin constructor
	function Plugin ( element, options ) {
		this.element = element;
		// jQuery has an extend method which merges the contents of two or
		// more objects, storing the result in the first object. The first object
		// is generally empty as we don't want to alter the default options for
		// future instances of the plugin
		this.settings = $.extend( {}, defaults, options );
		this._defaults = defaults;
		this._name = pluginName;
		this.init();
	}

	// Avoid Plugin.prototype conflicts
	$.extend(Plugin.prototype, {
		init: function () {
			var $img = $(this.element);
			// exclude hidden elements
			// jQuery does not support getting the offset coordinates of hidden elements
			if ($img.is(":visible")) {
				var offset = $img.offset();
				var imgInfo = {
					top: offset.top,
					left: offset.left,
					width: $img.width(),
					height: $img.height()
				};
				var $empty_image = $("<img>", {
					src: this.settings.empty_image_source,
					width: imgInfo.width,
					height: imgInfo.height
				});
				var $loader =  $("<img>");

				$loader.load(function() {
					$(this).css({
						position: "absolute",
						"z-index": 2147483647,
						left: imgInfo.left + (imgInfo.width / 2) - ($(this).width() / 2),
						top: imgInfo.top + (imgInfo.height / 2) - ($(this).height() / 2)
					});
				});

				$loader.attr({
					src: this.settings.loader_source
				});

				image_array.push($img.replaceWith($empty_image));
				loader_array.push($loader);
				empty_image_array.push($empty_image);

				$("body").append($loader);
			}


			// Place initialization logic here
			// You already have access to the DOM element and
			// the options via the instance, e.g. this.element
			// and this.settings
			// you can add more functions like the one below and
			// call them like so: this.yourOtherFunction(this.element, this.settings).
			console.log("xD");
		},
		yourOtherFunction: function () {
			// some logic
		}
	});

	// A really lightweight plugin wrapper around the constructor,
	// preventing against multiple instantiations
	$.fn[ pluginName ] = function ( options ) {
		return this.each(function() {
			if ( !$.data( this, "plugin_" + pluginName ) ) {
				$.data( this, "plugin_" + pluginName, new Plugin( this, options ) );
			}
		});
	};

})( jQuery, window, document );
